import React from "react";
import { Bar } from "recharts";

const LanguageBarChart = ({ data }) => {
  return (
    <div className="chart">
      <h2>언어 성장률</h2>
      <Bar
        width={500}
        height={300}
        data={data}
        margin={{ top: 10, right: 30, left: 0, bottom: 0 }}
      >
        {data.map((lang, index) => (
          <Bar key={index} name={lang.language} uv={lang.trend_score} />
        ))}
      </Bar>
    </div>
  );
};

export default LanguageBarChart;
